// import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import MyPage from "./pages/MyPage";  // 마이페이지 메인
import Settings from "./pages/Settings";  // 설정 페이지
import Guide from "./pages/guide";    // 이용안내 페이지
import Notifications from "./pages/Notifications"; // 알림 설정 페이지
import EditProfile from "./pages/EditProfile";    // 정보 수정 페이지
import PrivacyPolicy from "./pages/PrivacyPolicy";    // 개인정보 처리 방침 페이지

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<MyPage />} /> {/* 기본 경로, 마이페이지 메인 화면*/}
                <Route path="/settings" element={<Settings />} /> {/* 설정 */}
                <Route path="/guide" element={<Guide />} /> {/* 이용 안내 */}
                <Route path="/settings/notifications" element={<Notifications />} /> {/* 알림 설정 */}
                <Route path="/settings/edit-profile" element={<EditProfile />} /> {/* 정보 수정 */}
                <Route path="/settings/privacy-policy" element={<PrivacyPolicy />} /> {/* 개인정보 처리 방침 */}
            </Routes>
        </BrowserRouter>
    );
}

export default App;
